import React, {useState} from "react";
import {useDispatch, useSelector} from "react-redux";
import Button from "@material-ui/core/Button/Button";
import {getEmailUs} from "../actions/emailUs.action";
import {appConstants} from "../constants/constant";
import {getTr} from "../actions/tr.action";
import TableCell from "@material-ui/core/TableCell/TableCell";
import TableRow from "@material-ui/core/TableRow/TableRow";
import TableHead from "@material-ui/core/TableHead/TableHead";
import Table from "@material-ui/core/Table/Table";
import TableContainer from "@material-ui/core/TableContainer/TableContainer";
import TableBody from "@material-ui/core/TableBody/TableBody";


const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});


const AdminPage = () => {

    const classes = useStyles();

    const dispatch = useDispatch();

    const adminState = useSelector(appState => {
        return {
            eu: appState.eu,
            tr: appState.tr
        };
    });

    const getUnhandledEu = (event) => {
        event.preventDefault();
        dispatch(getEmailUs());

    };

    const getUnhandledTr = (event) => {
        event.preventDefault();
        dispatch(getTr());

    };


    const showEus = (event) => {
        event.preventDefault();
        console.log(adminState.eu[0]);

    };

    // {
    //     euState.eu.map((element) => {
    //         return <p>{element}</p>
    //     })
    // }

    {/*<p>{euState.eu[0].id}</p>*/}

    return (
        <div>
            <form>
                <button onClick = {getUnhandledEu}>getEu</button>
                <button onClick = {showEus}>showEu</button>
                {
                    adminState.eu ?
                        adminState.eu.map((element) => {
                            return <p>{element.id}</p>
                        })
                    :
                    <span></span>
                }

                <button onClick = {getUnhandledTr}>getEu</button>
                {
                    adminState.tr ?
                        adminState.tr.map((element) => {
                            return <p>{element.id}</p>
                        })
                        :
                        <span></span>
                }

            </form>
            <TableContainer component={Paper}>
                <Table className={classes.table} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Dessert (100g serving)</TableCell>
                            <TableCell align="right">Calories</TableCell>
                            <TableCell align="right">Fat&nbsp;(g)</TableCell>
                            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                            <TableCell align="right">Protein&nbsp;(g)</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row) => (
                            <TableRow key={row.name}>
                                <TableCell component="th" scope="row">
                                    {row.name}
                                </TableCell>
                                <TableCell align="right">{row.calories}</TableCell>
                                <TableCell align="right">{row.fat}</TableCell>
                                <TableCell align="right">{row.carbs}</TableCell>
                                <TableCell align="right">{row.protein}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

        </div>

    );
};
export default AdminPage;
